import SongItem from "./SongItem";


const Songlist= (props)=>{
    return (
        <div>
            {props.songs.map(song=><SongItem
            title = {song.title}
            artist = {song.artist}
            album={song.album}
            duration={song.duration}
            link = {song.link}
            like={song.like}
            />)}
            <SongItem
                title={props.songs[0].title}
                artist={props.songs[0].artist}
                album={props.songs[0].album}
                duration={props.songs[0].duration}
                link = {props.songs[0].link}
                like={props.songs[0].like}
            />
            <SongItem
                title={props.songs[1].title}
                artist={props.songs[1].artist}
                album={props.songs[1].album}
                duration={props.songs[1].duration}
                link = {props.songs[1].link}
                like={props.songs[1].like}
            />
            <SongItem
                title={props.songs[2].title}
                artist={props.songs[2].artist}
                album={props.songs[2].album}
                duration={props.songs[2].duration}
                link = {props.songs[2].link}
                like={props.songs[2].like}
            />
        </div>
    );
}
export default Songlist;
